import logo from './logo.svg';
import './App.css';

function App() {
  return (
<nav>
    <div className="nav-wrapper nav_bar">
    <ul id="nav-mobile" className="left">
      <li><Link to="/clients"> Clients </Link></li>
      <li><Link to="/actions"> Actions </Link></li>
      <li><Link to="/analytics"> Analytics </Link></li>
    </ul>
  </div>
</nav>
  );
}

export default App;
